import 'isomorphic-fetch';
import { useContext, useEffect } from 'react';
import { useRouter } from 'next/router';
import Layout from '../components/Layout';
import CardsContainer from '../components/CardsContainer';
import { userContext } from '../userContext';



const index = () => {
  const { isAuth } = useContext(userContext);
  const router = useRouter();

  useEffect(() => {
    if (!isAuth) {
      router.push('/login');
    }
  }, [isAuth]);

  const toDo = {
    title: 'esto es un to do',
    description: 'Ipsum recusandae ipsam et sed sit quasi. Facilis illum fugit autem consequatur accusamus sunt eveniet et. Dolor eius et. Et eius tempore aut labore reiciendis totam vel nostrum eius. Odio sunt est impedit. Et est accusamus et minus delectus voluptates id. Deserunt voluptas ducimus et.',
    done: true,
  };
  return (
    <>
      <Layout title="Home">
        <CardsContainer toDo={toDo} />
      </Layout>

      <style jsx global>
        {`
          * {
            margin: 0;
            padding: 0;
          }
        `}
      </style>
    </>
  );
};

export default index;
